SQL_OUTPUT:
SELECT si.title, si.study_details ->> 'treatment' AS treatment
FROM tbl_studies_info si
WHERE si.title = 'Effect of Vibroacoustic Therapy on Acute Stress in University Students';

SELECT si.title, si.study_details->>'study_type' AS study_type
FROM tbl_studies_info si
WHERE si.title = 'Recreational Diving Practice for Stress Management (DIVSTRESS)';

SELECT s.title, s.description, s.study_details ->> 'source' AS source, s.study_details ->> 'study_type' AS study_type
FROM tbl_studies_info s
WHERE s.title = 'Homeopathic Preparation Plumbum Metallicum for Lead Poisoning';

SELECT si.title, si.study_details ->> 'enrollment' AS enrollment_count
FROM tbl_studies_info si
WHERE si.title = 'Recipient Vessels for Free Tissue Flaps in Advanced Oncologic Defects of the Midface and Scalp';
